import React, { Component } from 'react'

class TrackList extends Component {

    constructor(props){
        super(props);

        this.state= {
            tracks: this.props.trackList
        }
    }

    render() {
        return (
            <div>
                { console.log(this.state.tracks)}
            </div>
        )
    }
}

export default TrackList;
